import React, { useEffect, useState, useRef } from "react";
import { Container, Row, Col, Card, CardHeader, CardBody } from "shards-react";
import PageTitle from "../common/PageTitle";
import Pagination from "../pagination.js";
import moment from "moment";

import {
  ListGroup,
  ListGroupItem,
  Form,
  FormInput,
  FormGroup,
  FormCheckbox,
  FormSelect,
  Button
} from "shards-react";

function CheckList({transactionInstance}){
  
  const [limit, setLimit] = useState(10);
  const [page, setPage] = useState(1);
  const [block_list, setblock_list] = useState([]);
  const [loading, setLoading] = useState(false);
  const [first, setFirst] = useState(false);

  const [detail, setDetail] = useState(false);
  const [detailcnt, setDetailcnt] = useState(-1);

  const detail_click = (cnt) => {
    setDetail(true);
    setDetailcnt(cnt);
  }

  function repeatboardchild(child, start){
    if(loading){

      let arr = [];

      if(start == 1) start = 0;
      else{
        start--;
        start *= 10;
      }
  
      let end = start + 10;
  
      if (end > child.length){
        end = child.length;
      }
  
      console.log('child = ', child);
      
      console.log('child.length = %d', child.length);
      for(let i = start; i < end; i++){
        console.log('i = %d, start = %d, end = %d', i, start, end);
        // if(sessionStorage.getItem('search') === null){
          arr.push(
          <tr key={i} onClick={() => detail_click(i)} style={{cursor: "pointer"}}>
            <th scope="row" >{i+1}</th>
            <td >{child[i].checktype}</td>
            <td>{child[i].responsible}</td>
            {/* <td>{child[i].filetype}</td>
            <td>{child[i].filedes}</td> */}
            <td>{child[i].time}</td>
          </tr>
          )
        // }
        // else if(sessionStorage.getItem('search') === child[i].name || sessionStorage.getItem('search') === child[i].responsible || sessionStorage.getItem('search') === child[i].filetype || sessionStorage.getItem('search') === child[i].filedes){
        //   arr.push(
        //     <tr key={i} onClick={() => detail_click(i)} style={{cursor: "pointer"}}>
        //       <th scope="row" >{i+1}</th>
        //       <td >{child[i].name}</td>
        //       <td>{child[i].responsible}</td>
        //       <td>{child[i].filetype}</td>
        //       <td>{child[i].filedes}</td>
        //       <td>{child[i].time}</td>
        //     </tr>
        //     )
        // }
      }
  
      return arr;
    }

  }

  
  function Showboard(){

    console.log(first);
    console.log(detail);

    if(!detail && first){
      return (
        <div>
        <Row>
          <Col>
            <Card small className="mb-4">
              <CardHeader className="border-bottom">
                <h6 className="m-0">Active Users</h6>
              </CardHeader>
              <CardBody className="p-0 pb-3">
                <table className="table mb-0">
                  <thead className="bg-light">
                    <tr>
                      <th scope="col" className="border-0">
                        #
                      </th>
                      <th scope="col" className="border-0">
                        File Name
                      </th>
                      <th scope="col" className="border-0">
                        Registrant
                      </th>
                      {/* <th scope="col" className="border-0">
                        File Type
                      </th>
                      <th scope="col" className="border-0">
                        File Des
                      </th> */}
                      <th scope="col" className="border-0">
                        Upload Time
                      </th>
                    </tr>
                  </thead>
                  <tbody>
                    {repeatboardchild(block_list, page)}
                  </tbody>
                </table>
              </CardBody>
            </Card>
          </Col>
        </Row>
        
        <Pagination
              total={block_list.length}
              limit={limit}
              page={page}
              setPage={setPage}
            />
            </div>
      )
    }
    else if (detail && first){
      

      if(block_list[detailcnt].checktype == "Electricity"){

        return (
          
          <Row>
            <Col lg="7" md="12">
            <Card small>
            <CardHeader className="border-bottom">
              <h6 className="m-0">Form Example</h6>
            </CardHeader>
              <ListGroup flush>
              <ListGroupItem className="p-3">
                <Row>
                  <Col>
                        <label htmlFor="feInputState"></label>
                        <br></br>
                        {block_list[detailcnt].category}

                        <br></br>
                        <br></br>
                        <label htmlFor="feInputAddress"> </label>
                        <br></br>
                        {block_list[detailcnt].checktype}
                      
                        <br></br>
                        <br></br>
                        <label htmlFor="feInputAddress2">1. .</label>
                        <br></br>
                      {block_list[detailcnt].des1 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">2. .</label>
                      <br></br>
                      {block_list[detailcnt].des2 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">3.  .</label>
                      <br></br>
                      {block_list[detailcnt].des3 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">4. , .</label>
                      <br></br>
                      {block_list[detailcnt].des4 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">5. .</label>
                      <br></br>
                      {block_list[detailcnt].des5 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">6. .</label>
                      <br></br>
                      {block_list[detailcnt].des6 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">7. , .</label>
                      <br></br>
                      {block_list[detailcnt].des7 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">8. .</label>
                      <br></br>
                      {block_list[detailcnt].des8 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">9. .</label>
                      <br></br>
                      {block_list[detailcnt].des9 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">10. .</label>
                      <br></br>
                      {block_list[detailcnt].des10 ? "YES" : "NO"}
                      
                        <br></br>
                        <br></br>
                        <label htmlFor="feInputAddress2"> </label>
                        <br></br>
                        {block_list[detailcnt].registrant}
                      
                        <br></br>
                        <br></br>
                        <label htmlFor="feInputAddress2"> </label>
                        <br></br>
                        {block_list[detailcnt].responsible}
                        
                      
                  </Col>
                </Row>
              </ListGroupItem>
            </ListGroup>
            </Card>
            </Col>
          </Row>
        )
      }


      else if(block_list[detailcnt].checktype == "Welding"){

        return (
          
          <Row>
            <Col lg="7" md="12">
            <Card small>
            <CardHeader className="border-bottom">
              <h6 className="m-0">Form Example</h6>
            </CardHeader>
              <ListGroup flush>
              <ListGroupItem className="p-3">
                <Row>
                  <Col>
                        <label htmlFor="feInputState"></label>
                        <br></br>
                        {block_list[detailcnt].category}

                        <br></br>
                        <br></br>
                        <label htmlFor="feInputAddress"> </label>
                        <br></br>
                        {block_list[detailcnt].checktype}
                      
                        <br></br>
                        <br></br>
                        <label htmlFor="feInputAddress2">1. .</label>
                        <br></br>
                      {block_list[detailcnt].des1 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">2. , .</label>
                      <br></br>
                      {block_list[detailcnt].des2 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">3. .</label>
                      <br></br>
                      {block_list[detailcnt].des3 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">4. .</label>
                      <br></br>
                      {block_list[detailcnt].des4 ? "YES" : "NO"}
                      
                      <br></br>
                      <br></br>
                      <label htmlFor="feInputAddress2">5. .</label>
                      <br></br>
                      {block_list[detailcnt].des5 ? "YES" : "NO"}
                      
                      <br></br>
