    async function updateAllTransactions(e){
      if(transactionInstance && !first){

        console.log(transactionInstance)
        let events = await transactionInstance.getPastEvents('checkTransaction', {fromBlock:0, toBlock:'latest'});
        
  
  
        for(let i = events.length - 1; i >= 0; i--){
          
          var time_ = moment.unix(events[i].returnValues.time);
          let temp_des = [];
          for(let j = 0; j < 10; j++){
            let temp = 0;
            if(events[i].returnValues.des[j].toString() == "true"){
              temp = 1;
            }
            temp_des.push(temp)
          }
          
          block_list.push({
            id: nextId.current,
            category : events[i].returnValues.category.toString(),
            checktype : events[i].returnValues.checktype.toString(),
            time : time_.toString(), 
            des1 : temp_des[0],
            des2 : temp_des[1],
            des3 : temp_des[2],

            des4 : temp_des[3],
            des5 : temp_des[4],
            des6 : temp_des[5],
            des7 : temp_des[6],
            des8 : temp_des[7],
            des9 : temp_des[8],
            des10 :temp_des[9],
            registrant : events[i].returnValues.registrant.toString(),
            responsible : events[i].returnValues.responsible_manager.toString(),
          }
          )
          
          nextId.current += 1;
  
          console.log(events[i].returnValues);
        }
        setLoading(true);
        setFirst(true);
        console.log('events.length = ', events.length);
        console.log(events);
        console.log('block_list = ', block_list);
      }
  
    }

